import * as i0 from "@angular/core";
import * as i1 from "src/app/service/service-login.service";
import * as i2 from "src/app/service/service-dato-vistas.service";
import * as i3 from "../../../elements/nav-bar/nav-bar.component";
import * as i4 from "@angular/forms";
export class InicioComponent {
    constructor(serviceLogin, serviceModeloVista) {
        this.serviceLogin = serviceLogin;
        this.serviceModeloVista = serviceModeloVista;
        this.productosModelo = [];
    }
    ngOnInit() {
        this.loadScripts();
    }
    /*
    login(){
      const user = {cuenta: this.usuario};
      this.serviceLogin.login(user).subscribe( data => {
        console.log(data);
      });
    }*/
    obtenerModelos() {
        this.serviceModeloVista.getModelos().subscribe(data => {
            console.log(data);
            this.productosModelo = data;
        });
    }
    loadScripts() {
        // This array contains all the files/CDNs 
        const dynamicScripts = [
            'assets/js/vendor/jquery-3.3.1.min.js',
            'assets/js/vendor/modernizr-3.6.0.min.js',
            'assets/js/vendor/jquery.cookie.js',
            'assets/js/vendor/wow.min.js',
            'assets/js/bootstrap.min.js',
            'assets/js/plugins.js',
            'assets/js/popper.min.js',
            'assets/js/lazysizes.js',
            'assets/js/main.js',
            //Load all your script files here'
        ];
        for (let i = 0; i < dynamicScripts.length; i++) {
            const node = document.createElement('script');
            node.src = dynamicScripts[i];
            node.type = 'text/javascript';
            node.async = false;
            document.getElementsByTagName('head')[0].appendChild(node);
        }
    }
